import Link from "next/link";

const Navbar = () => (
  <div>
    <style jsx>{`
      ul {
        background: #333;
        color: #fff;
        list-style
      }
    `}</style>
    <ul>
      <li>
        <Link href="/">Home</Link>
        <Link href="/about">About</Link>
      </li>
    </ul>
  </div>
);

export default Navbar;
